        <div class="row">
        <div class="col">
            <input type="text" class="form-control" placeholder="First name" aria-label="First name"/>
        </div>
         <div class="col">
            <input type="text" class="form-control" placeholder="Last name" aria-label="Last name"/>
        </div>
        </div>
        <button className='bd-highlight" w-20'>Login</button>
        <button className='position-absolute top-0 start-20 w-20'>Sign up</button>
      </div>
    );
  }
  
